  false,\n\t\"url\": null,\n\t\"notes\": \"This document is an analysis and summary
  of progress toward achieving the interim management objectives for the Russian River
  during the 1979 season.  Additionally, several specific problems were outlined last
  spring and each of these will be discussed in terms of progress during the 1979
  season. Also included within this report will be general Russian River fisheries
  statistics, public use census of various related facilities, and overall fisherman
  effort. Impressions and suggestions of Russian River seasonal staff, as well as
  Kenai NMR professional staff, will also be included. A general report, produced
  by the Alaska Department of Fish and Game was used in this analysis and is available
  for later reference.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
